import React, { useEffect, useState } from 'react';
import { Link, Outlet, useLocation } from 'react-router-dom';
import './MsTeams.css';
import chat from '../Sections/chat.png';
import meet from '../Sections/video.png';
import teams from '../Sections/team.png';
import mscalendar from '../Sections/teamscalendar.png';
import notification from '../Sections/notification.png';
import settings from '../Sections/setting.png';
import msteams from '../Sections/msteams.png';

export const MsTeams = () => {
  const location = useLocation();
  const [lastScrollTop, setLastScrollTop] = useState(0);
  const [lastTime, setLastTime] = useState(Date.now());
  const [action, setAction] = useState("");

  const menuItems = [
    { to: "chat", icon: chat, label: "Chat" },
    { to: "meet", icon: meet, label: "Meet" },
    { to: "communities", icon: teams, label: "Teams" },
    { to: "mscalendar", icon: mscalendar, label: "Calendar" },
    { to: "notification", icon: notification, label: "Activity" },
  ];

  // Function to simulate saving behavior
  const saveBehavior = (key, value) => {
    const existing = JSON.parse(localStorage.getItem("userBehaviors")) || [];
    const newBehavior = {
      key,
      value,
      timestamp: new Date().toLocaleString(),
    };
    localStorage.setItem("userBehaviors", JSON.stringify([...existing, newBehavior]));
  };

  // Trigger enlarge mode (e.g., hide sidebar or enlarge content)
  const triggerEnlargeMode = () => {
    const wrapper = document.querySelector(".ms-wrapper");
    if (!wrapper.classList.contains("enlarge-mode")) {
      wrapper.classList.add("enlarge-mode");
      console.log("ðŸŸ£ Enlarge mode activated (MsTeams)");
    }
  };

  // Scroll behavior detection
  useEffect(() => {
    const handleScroll = () => {
      const currentScrollTop = window.scrollY;
      const currentTime = Date.now();

      const scrollDistance = Math.abs(currentScrollTop - lastScrollTop);
      const timeElapsed = (currentTime - lastTime) / 1000;
      const scrollVelocity = scrollDistance / timeElapsed;
      const cappedVelocity = Math.min(scrollVelocity, 100); // prevent extreme spikes

      setLastScrollTop(currentScrollTop);
      setLastTime(currentTime);

      // âœ… Your chosen "if" logic
      if (cappedVelocity < 30 && cappedVelocity > 0) {
        // ðŸ•’ Add a 2-second delay before triggering enlarge mode
        clearTimeout(window.scrollDelayTimeout);
        window.scrollDelayTimeout = setTimeout(() => {
          setAction("Slow Scroll Detected");
          saveBehavior("Scroll Velocity (<30px/s)", `${cappedVelocity.toFixed(1)} px/s`);
          triggerEnlargeMode();
        }, 2000);
      }
    };

    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, [lastScrollTop, lastTime]);

  return (
    <div className="ms-wrapper">
      <div className="ms-sidebar">
        <div className="ms-sidebar-logo">
          <Link to='/'>
            <img src={msteams} alt="Teams" />
          </Link>
        </div>

        <div className="ms-menu">
          {menuItems.map((item) => (
            <Link
              to={item.to}
              key={item.to}
              className={`ms-menu-item ${location.pathname.includes(item.to) ? 'active' : ''}`}
            >
              <img src={item.icon} alt={item.label} />
            </Link>
          ))}
        </div>

        <div className="ms-sidebar-bottom">
          <Link to="settings-ms" className="ms-menu-item">
            <img src={settings} alt="Settings" />
          </Link>
        </div>
      </div>

      {/* Main Content */}
      <div className="ms-content">
        <div className="ms-topbar">
          <input className="ms-searchbar" placeholder="Search" />
          <div className="ms-top-right">
            <img src={notification} alt="Alerts" className="icon-small" />
            <img src={settings} className="icon-small" alt="Settings" />
            <div className="profile-circle"></div>
          </div>
        </div>
        <div className="ms-page">
          <Outlet />
        </div>
      </div>
    </div>
  );
};
